import { useEffect, useState } from "react";
import { HOST } from "../Setup";

function ProfessorDetails(props) {
  const [professorDetails, setProfessorDetails] = useState(null);

  useEffect(() => {
    setLoading(true);
    let url = HOST + "/professors/" + props.professor.id;

    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          setProfessorDetails(response);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return <div>{props.professor.id}</div>;
}

export default ProfessorDetails;
